import React from 'react';
import '../assets/styles/Header.css';

const Header = () => {
    return (
        <header className="header-container">
            <div className="header-content">
                <div className="header-text">
                    <h1 className="glitch-effect">
                        <span aria-hidden="true">ByEmmanuel Dev</span>
                        ByEmmanuel Dev
                        <span aria-hidden="true">ByEmmanuel Dev</span>
                    </h1>
                    <p className="subtitle">Desarrollador Web Frontend</p>
                    <p className="description">Creando experiencias digitales memorables con código limpio y diseño intuitivo</p>

                    <div className="cta-buttons">
                        <a href="#projects" className="btn btn-primary">Ver Proyectos</a>
                        <a href="#contact" className="btn btn-secondary">Contáctame</a>
                    </div>
                </div>

                <div className="header-graphic">
                    <div className="code-snippet">
     <pre><code className="language-java">
{`static void Passion() {
    System.out.println("🚀 Explorando mi pasión...");

    String[] pilares = {
        "Ingeniería en Computación",
        "Ciberseguridad",
        "Matemáticas Aplicadas",
        "Desarrollo de Software",
        "Linux y Terminal ZSH",
        "Trading y Finanzas Cuantitativas"
    };

    System.out.println("\\n💡 Filosofía: Automatizar, Analizar y Aprender.");

    System.out.println("\n💡 Filosofía: Automatizar & Analizar");
System.out.println("🔐 Ciberseguridad = mentalidad");
System.out.println("⌨️ zsh: terminal de poder");
System.out.println("🍎 SO: macOS + Arch");
}`}
                        </code></pre>
                    </div>
                </div>
            </div>

            <nav className="header-nav">
                <ul>
                    <li><a href="#about">Sobre mí</a></li>
                    <li><a href="#projects">Proyectos</a></li>
                    <li><a href="#skills">Habilidades</a></li>
                    <li><a href="#contact">Contacto</a></li>
                </ul>
            </nav>

            <div className="scroll-indicator">
                <div className="mouse">
                    <div className="wheel"></div>
                </div>
                <div className="arrow-scroll">Scroll</div>
            </div>
        </header>
    );
};

export default Header;
